import {
    LOGIN,
    SIGNUP
} from './actionTypes'


export const initState = {
    loginSuccess:[]
}

export default (state = initState, { type, payload }) => {
    console.log(payload)

    switch (type) {
        case LO:
            return{
                ...state,
                loginSuccess:payload.role
            }

        default:
            return state
    }
}
